import './Sidebar.css';
import explogo from './img/explogo.png';

    const Sidebar = () => {
      return (
        <div className="sidebar">
          <div className="logo"><img src={explogo} alt="explogo" className="logo-img"/></div>
          <h2>ASSET <br/>MANAGEMENT</h2>
            <h3>Menu</h3>
          <ul>
            <li><a class="active" href="/dashboard">Home</a></li>
            <li><a class="active2" href="/assets">Assets</a></li>
            <li><a href="/custodians">Custodians</a></li>
            <li><a href="#">Settings</a></li>

          </ul>
        </div>
      );
    };

    export default Sidebar;
